import { useState } from "react";
import './App.css';
import Select from "./components/select";
const App = () => {
  const [SelectData] = useState([{
    "no": "347",
    "name": "資工系"
  },{
    "no": "348",
    "name": "電機系"
  }]);
  return (
    <div className="App">
      <Select SelectData={SelectData}/>
    </div>
  );
}

export default App;
